//import logo from './logo.svg';
//import './App.css';
import './custom.css'
//import './custom.scss'

function Home() {
  return (
    <div class="test">

      <h1>Hello World from React!</h1>
      <button className="custom-button">Custom Button</button>
      <button className="btn btn-primary">Custom Button</button>

      <nav class="navbar bg-body-tertiary">
        <form class="container-fluid justify-content-end" style="padding-top: 50px;" >
          <button class="btn"> <span class="border-text">Yes!Places</span></button>
          <button class="btn btn-outline-dark btn-space" style="width: 12%; border: solid 5px; background-color: #C4EBFF">About</button>
          <button class="btn btn-outline-dark m-1" style="width: 12%; border: solid 5px; background-color: #C4EBFF" type="button">Restaurants</button>
          <button class="btn btn-outline-dark m-1" style="width: 12%; border: solid 5px; background-color: #C4EBFF" type="button">Pet Restaurants</button>
          <button class="btn btn-outline-dark m-1" style="width: 12%; border: solid 5px; background-color: #C4EBFF" type="button">Cooking Recipes</button>
          <button class="btn btn-outline-dark m-1" style="width: 12%; border: solid 5px; background-color: #C4EBFF" type="button">Hotels</button>
          <button class="btn btn-outline-dark m-2" style="width: 12%; border: solid 5px; background-color: #C4EBFF" type="button">Home</button>
        </form>
      </nav>

    </div>


  );
}

export default Home;
